column6:
Размеры: ширина 17 см, высота 31 см, толщина 7 см.
Имеет 2 основных отдела на змейках, в одном из которых есть боковой карман на змейке и нашивной открытый отдел для мелочей. На тыльной стороне есть карманчик на молнии. Для комфортного пользования ремни можно отстегать и носить аксессуар на одном плече или через шею.

Бренд: Luxon; Застежка: змейка; Формат А4: нет; Количество основных отделов: 2; Внутренняя отделка: текстиль; Специальный отдел для техники: нет; Ремень через плечо: Есть; Стиль: Casual; Сезон: Мультисезон; Цвет: Черный; Материал: натуральная кожа; Упаковка: транспортная; Размер сумки: Маленький; : ;
